import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Container, Row, Col} from 'react-bootstrap';
import { useParams } from "react-router-dom";
import 'bootstrap/dist/css/bootstrap.min.css';
import NavSc from '../componentes/navbar';
import Bootfooter from '../componentes/BSfooter';
import Card from 'react-bootstrap/Card';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
import Figure from 'react-bootstrap/Figure';
import '../componentes/style.css';
import logo4 from '../logo4.png';


function Salasmodfic() {
  
  const { id } = useParams();
  const [sala, setFormData] = useState([]);
  
  useEffect(() => {
      async function fetchFormData () {
      
      try {
        
        console.log('id =' + id);
        const response = await axios.get(`http://localhost:2527/api/fndsalas/${id}`);
        setFormData(response.data);      
        console.log('response ' + response.data);
      } catch (error) {
        console.error(error);
      }
  
      };

      fetchFormData();
    },[id]); 

      const handleChange = (event) => {
        const {name, value} = event.target;
        setFormData({...sala, [name]: value});
      };
  return (    

    <Container fluid>

      <NavSc/>

      <Card>
      <Card.Body>
      <Row>
      <Col>
        <Form>
        <Form.Group as={Row} className="me-2" controlId="formBasicEmail">
          <Form.Label>Descrição:</Form.Label>
          <Col sm={6}>
          <Form.Control type="text" placeholder="" value={sala.descricao} onChange={handleChange}/>
          </Col>
        </Form.Group>
        <Form.Group as={Row} className="me-2" controlId="formBasicPassword">
          <Form.Label>Número da Sala:</Form.Label>
          <Col sm={6}>
          <Form.Control type="text" placeholder="" value={sala.numero} onChange={handleChange}/>
          </Col>
        </Form.Group>
        <Form.Group as={Row} className="me-2" controlId="formBasicPassword">
          <Form.Label>Capacidade da Sala:</Form.Label>
          <Col sm={6}>
          <Form.Control type="text" placeholder="" value={sala.capacidade} onChange={handleChange}/>
          </Col>
        </Form.Group>
        <Form.Group as={Row} className="me-2" controlId="formBasicPassword">
          <Form.Label>Valor da Sala:</Form.Label>
          <Col sm={6}>
          <Form.Control type="text" placeholder="" value={sala.valor} onChange={handleChange}/>
          </Col>
        </Form.Group>
        <Form.Group as={Row} className="me-2" controlId="formBasicPassword">
          <Form.Label>Link da imagem da Sala:</Form.Label>
          <Col sm={6}>
          <Form.Control type="text" placeholder="" value={sala.imgsala} onChange={handleChange}/>
          </Col>
        </Form.Group>
        <Form.Group as={Row} className="me-2" controlId="formBasicCheckbox">
          <Col sm={6}>
          <Form.Check type="checkbox" label="Check me out" />
          </Col>
        </Form.Group>
        <Button variant="dark" size='lg' type="submit">
          SALVAR
        </Button>
        <Button variant="warning" size='lg' type="submit" href='../index'>
          CANCELAR
        </Button>
      </Form>
      </Col>
      <Col sm={2}>
      <Figure>
          <Figure.Image
            width={200}
            height={800}
            alt="img"
            src={logo4}
          />
        </Figure>
      </Col>
      <Col sm={5}>
      <Figure>
          <Figure.Image rounded
            width={500}
            height={200}
            alt="img"
            src={sala.imgsala}
          />
        </Figure>
      </Col>
      </Row>
      </Card.Body>
      </Card>
      
      <Bootfooter/>

    </Container>
  );
}

export default Salasmodfic;
